import React from "react";

import city from "../../data/city.json";

const City = () => {
  return (
    <div className="container">
      city.map
      <div className="col">
        <img src={item.image}></img>

        {item.name}
        {item.subText}
      </div>
    </div>
  );
};
export default City;
